// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract InvestmentPools {
    AggregatorV3Interface internal priceFeed;
    address public owner;

    constructor(address _priceFeedAddress) {
        priceFeed = AggregatorV3Interface(_priceFeedAddress);
        owner = msg.sender;
    }

    function getLatestETHPrice() public view returns (uint256) {
        (
            , int price, , , 
        ) = priceFeed.latestRoundData();
        return uint256(price * 1e10); // Convert to 18 decimals
    }

    struct Pool {
        string name;
        uint256 goal;
        uint256 totalInvested;
        uint256 deadline;
        uint256 tokenAmount;
        address[] investors;
        mapping(address => uint256) investments;
        bool isClosed;
    }

    mapping(uint256 => Pool) public pools;
    uint256 public poolCount;

    event PoolCreated(uint256 poolId, string name, uint256 goal, uint256 deadline);
    event InvestmentMade(uint256 poolId, address investor, uint256 amount);
    event PoolClosed(uint256 poolId);
    event FundsReturned(uint256 poolId, address investor, uint256 amount);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner");
        _;
    }

    function createPool(
        string memory _name,
        uint256 _goal,
        uint256 _durationInDays,
        uint256 _tokenAmount
    ) public onlyOwner {
        require(_goal > 0 && _durationInDays > 0 && _tokenAmount > 0, "Invalid input");

        Pool storage newPool = pools[poolCount];
        newPool.name = _name;
        newPool.goal = _goal;
        newPool.totalInvested = 0;
        newPool.deadline = block.timestamp + (_durationInDays * 1 days);
        newPool.tokenAmount = _tokenAmount;
        newPool.isClosed = false;

        emit PoolCreated(poolCount, _name, _goal, newPool.deadline);
        poolCount++;
    }

    function invest(uint256 _poolId) public payable {
        require(_poolId < poolCount, "Pool not found");
        require(!pools[_poolId].isClosed, "Pool closed");
        require(block.timestamp < pools[_poolId].deadline, "Pool expired");
        require(msg.value > 0, "Investment must be greater than 0");

        Pool storage pool = pools[_poolId];
        
        uint256 ethPrice = getLatestETHPrice();
        uint256 investmentInUSD = (msg.value * ethPrice) / 1e18;

        pool.totalInvested += msg.value;

        if (pool.investments[msg.sender] == 0) {
            pool.investors.push(msg.sender);
        }

        pool.investments[msg.sender] += msg.value;

        emit InvestmentMade(_poolId, msg.sender, msg.value);

        if (investmentInUSD >= pool.goal) {
            _closePool(_poolId);
        }
    }

    function checkAndClosePool(uint256 _poolId) public {
        require(_poolId < poolCount, "Pool not found");
        Pool storage pool = pools[_poolId];
        require(!pool.isClosed, "Pool closed");
        require(block.timestamp >= pool.deadline, "Pool not expired");

        if (pool.totalInvested >= pool.goal) {
            _closePool(_poolId);
        } else {
            _refundInvestors(_poolId);
        }
    }

    function _closePool(uint256 _poolId) internal {
        Pool storage pool = pools[_poolId];
        pool.isClosed = true;

        string memory tokenName = string(abi.encodePacked(pool.name, "_Token"));
        string memory tokenSymbol = "ABT";

        AgroBlockToken newToken = new AgroBlockToken(tokenName, tokenSymbol, pool.tokenAmount);

        for (uint256 i = 0; i < pool.investors.length; i++) {
            address investor = pool.investors[i];
            uint256 investment = pool.investments[investor];
            uint256 share = (investment * pool.tokenAmount) / pool.totalInvested;
            newToken.transfer(investor, share);
        }

        emit PoolClosed(_poolId);
    }

    function _refundInvestors(uint256 _poolId) internal {
        Pool storage pool = pools[_poolId];
        for (uint256 i = 0; i < pool.investors.length; i++) {
            address investor = pool.investors[i];
            uint256 investment = pool.investments[investor];
            if (investment > 0) {
                payable(investor).transfer(investment);
                pool.investments[investor] = 0;
                emit FundsReturned(_poolId, investor, investment);
            }
        }
        pool.isClosed = true;
        emit PoolClosed(_poolId);
    }
}

contract AgroBlockToken is ERC20 {
    constructor(
        string memory name,
        string memory symbol,
        uint256 initialSupply
    ) ERC20(name, symbol) {
        _mint(msg.sender, initialSupply);
    }
}
